INSERT INTO $$ETLVWDB.EL_POS_TRAN_SO_DEF_ALLC SELECT TRANS_ID, SALES_ORDER_LINE_KEY, SALES_MOTION_CD, COALESCE(DV_ALLOCATION_PCT/ NULLIF(SUM_ALLOC_PCT,0),0) AS DV_ALLOCATION_PCT, 'DEFAULT SOL ENRIHMENT' AS MATCH_TYPE FROM ( SELECT TRANS_ID, SALES_ORDER_LINE_KEY, SALES_MOTION_CD, DV_ALLOCATION_PCT , SUM(DV_ALLOCATION_PCT ) OVER (PARTITION BY TRANS_ID) AS SUM_ALLOC_PCT FROM $$ETLVWDB.EL_POS_TRAN_SOL_DEF_ALLC WHERE SALES_MOTION_CD IN ('NEW','RENEW') AND SALES_ORDER_LINE_KEY < 0 AND TRANS_ID IN ( SELECT TRANS_ID FROM $$ETLVWDB.EL_POS_TRAN_SOL_DEF_ALLC O WHERE SALES_MOTION_CD IN ('NEW','RENEW') AND SALES_ORDER_LINE_KEY < 0 AND EXISTS ( SEL 1 FROM $$ETLVWDB.EL_POS_TRAN_SOL_DEF_ALLC I WHERE I.TRANS_ID = O.TRANS_ID AND SALES_MOTION_CD NOT IN ('NEW','RENEW') AND SALES_ORDER_LINE_KEY < 0 ) ) ) A;
INSERT INTO $$ETLVWDB.EL_POS_TRAN_SO_DEF_ALLC SELECT SOL.*,NULL AS MATCH_TYPE FROM $$ETLVWDB.EL_POS_TRAN_SOL_DEF_ALLC SOL WHERE NOT EXISTS ( SEL 1 FROM $$ETLVWDB.EL_POS_TRAN_SO_DEF_ALLC SO WHERE SOL.TRANS_ID=SO.TRANS_ID);
CALL COLLECT_STATS_WRAP('$$ETLVWDB','EL_POS_TRAN_SO_DEF_ALLC','D');

CREATE VOLATILE TABLE POS_TRAN_DEF_ALLC AS (SEL TRANS_ID FROM $$ETLVWDB.EL_POS_TRAN_SO_DEF_ALLC MINUS SEL TRANS_ID FROM $$ETLVWDB.EL_POS_TRAN_DIST_HQ_DEF_ALLC ) WITH DATA ON COMMIT PRESERVE ROWS;
INSERT INTO $$ETLVWDB.EL_POS_TRAN_DIST_HQ_DEF_ALLC SEL TRANS_ID , SALES_ORDER_LINE_KEY , 'NEW' AS SALES_MOTION_CD , 1.00 AS DV_ALLOCATION_PCT, 'DEFAULT_SM_TAGGING' AS MATCH_TYPE FROM $$ETLVWDB.EL_POS_TRAN_SO_DEF_ALLC WHERE TRANS_ID IN (SEL TRANS_ID FROM POS_TRAN_DEF_ALLC) GROUP BY 1,2,3,4;
