INSERT INTO $$ETLVWDB.EL_POS_TRAN_DIST_HQ_DEF_ALLC SEL TRANS_ID , SALES_ORDER_LINE_KEY , 'RENEW' AS SALES_MOTION_CD , 0.54 AS DV_ALLOCATION_PCT, '46_54 ENRICHMENT' AS MATCH_TYPE FROM $$ETLVWDB.EL_POS_TRAN_SO_DEF_ALLC WHERE TRANS_ID IN (SEL TRANS_ID FROM POS_TRAN_DEF_ALLC) GROUP BY 1,2,3,4;
